'use strict';

require('plugins/kibana/management/sections');

require('plugins/kibana/management/styles/main.less');

require('ui/filters/start_from');

require('ui/field_editor');

var _routes = require('ui/routes');

var _routes2 = _interopRequireDefault(_routes);

var _modules = require('ui/modules');

var _app = require('plugins/kibana/management/app.html');

var _app2 = _interopRequireDefault(_app);

var _landing = require('plugins/kibana/management/landing.html');

var _landing2 = _interopRequireDefault(_landing);

var _management = require('ui/management');

var _feature_catalogue = require('ui/registry/feature_catalogue');

require('ui/kbn_top_nav');

function _interopRequireDefault(obj) { return obj && obj.__esModule ? obj : { default: obj }; }

_routes2.default.when('/management', {
  template: _landing2.default
});

_routes2.default.when('/management/:section', {
  redirectTo: '/management'
});

require('ui/index_patterns/route_setup/load_default')({
  whenMissingRedirectTo: '/management/kibana/index'
});

_modules.uiModules.get('apps/management').directive('kbnManagementApp', function (Private, $location, timefilter) {
  return {
    restrict: 'E',
    template: _app2.default,
    transclude: true,
    scope: {
      sectionName: '@section',
      omitPages: '@omitBreadcrumbPages',
      pageTitle: '='
    },

    link: function link($scope) {
      timefilter.enabled = false;
      $scope.sections = _management.management.items.inOrder;
      $scope.section = _management.management.getSection($scope.sectionName) || _management.management;

      if ($scope.section) {
        $scope.section.items.forEach(function (item) {
          item.active = ('#' + $location.path()).indexOf(item.url) > -1;
        });
      }
    }
  };
});

_modules.uiModules.get('apps/management').directive('kbnManagementLanding', function (kbnVersion) {
  return {
    restrict: 'E',
    link: function link($scope) {
      $scope.sections = _management.management.items.inOrder;
      $scope.kbnVersion = kbnVersion;
    }
  };
});

_feature_catalogue.FeatureCatalogueRegistryProvider.register(function () {
  return {
    id: 'management',
    title: 'Management',
    description: 'Your center console for managing the Elastic Stack.',
    icon: '/plugins/kibana/assets/app_management.svg',
    path: '/app/kibana#/management',
    showOnHomePage: false,
    category: _feature_catalogue.FeatureCatalogueCategory.ADMIN
  };
});
